  return (
    <>
      <Head>
        <title>TMB Service Education</title>
      </Head>
      <div className="bg-gradient-to-b from-blue-900 to-blue-800 h-full">
        <Header></Header>
        <Etapas></Etapas>
      </div>
    </>

  );
}

export default SolicitacaoCredito;
